O PRESENTE INSTRUMENTO TEM POR FINALIDADE O DESENVOLVIMENTO DE AÇÕES CONJUNTAS ENTRE OS PARTÍCIPES, VISANDO À COOPERAÇÃO PARA A PROMOÇÃO DA EQUIDADE RACIAL NO PODER JUDICIÁRIO, NOS SEGUINTES EIXOS:

I. PROMOÇÃO DA EQUIDADE RACIAL NO PODER JUDICIÁRIO: I.A. FOMENTO À REPRESENTATIVIDADE RACIAL NO JUDICIÁRIO; I.B. REGULAMENTAÇÃO DE COMISSÕES DE HETEROIDENTIFICAÇÃO NOS TRIBUNAIS;

II. DESARTICULAÇÃO DO RACISMO INSTITUCIONAL:

II.A. FORMAÇÃO INICIAL E CONTINUADA DE MAGISTRADOS EM QUESTÕES RACIAIS;

II.B. AÇÕES DE PREVENÇÃO E COMBATE À DISCRIMINAÇÃO RACIAL NO ÂMBITO DO JUDICIÁRIO;

III. SISTEMATIZAÇÃO DOS DADOS RACIAIS DO PODER JUDICIÁRIO: III.A. APERFEIÇOAMENTO DA GESTÃO DOS BANCOS DE DADOS VISANDO À DEVIDA E NECESSÁRIA IMPLEMENTAÇÃO DE POLÍTICAS PÚBLICAS JUDICIÁRIAS DE EQUIDADE RACIAL BASEADAS EM EVIDÊNCIAS.

IV. ARTICULAÇÃO INTERINSTITUCIONAL E SOCIAL PARA A GARANTIA DE UMA CULTURA ANTIRRACISTA NA ATUAÇÃO DO PODER JUDICIÁRIO:

IV.A. ADOÇÃO E COMPARTILHAMENTO DE PRÁTICAS E AÇÕES VOLTADAS À CORREÇÃO DAS DESIGUALDADES RACIAIS, AMPLIANDO A CAPACIDADE DO PODER JUDICIÁRIO DE DIÁLOGO COM OS DEMAIS ÓRGÃOS DO SISTEMA DE JUSTIÇA E DE INTERLOCUÇÃO COM OS MOVIMENTOS SOCIAIS ORGANIZADOS.

